import React from "react";
import News from "../Components/News/News";
import AboutUs from "../Components/AboutUs/AboutUs";
import Footer from "../Components/Footer/Footer";

const Shop = () => {
    return (
        <div>
            <News />
            <AboutUs />
            <Footer />
        </div>
    )
}
export default Shop;
